import React from "react";
import { useState, useEffect } from "react";
import { toast, ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const ModifyPhoneTicket = ({ handleClose, ticket }) => {
    const [error, setError] = useState(null);
    console.log(ticket);
  
    const [service_type, setServiceType] = useState(
      ticket?.service_type || ""
    );
    const [reference, setReference] = useState(ticket?.reference || "");
    const [service_station, setServiceStation] = useState(
      ticket?.service_station || ""
    );
    const [call_time, setCallT] = useState(
      ticket?.ticket_type || ""
    );
    const [newTerminal_no, setnewTerminal_no] = useState(
      ticket?.terminal_no || ""
    );
    const [newservice_station, setnewservice_station] = useState(
      ticket?.service_station || ""
    );
    const [newclient, setnewclient] = useState(ticket?.client || "");
    const [newStaus, setnewStatus] = useState(ticket?.status || "");
    const [newadresse, setnewadresse] = useState(ticket?.adresse || "");
    const [newbranch_type, setnewbranch_type] = useState(
      ticket?.branch_type || ""
    );
  
    /*  useEffect(() => {
      console.log("Current ticket prop:", ticket);
      setnewModele(ticket?.modele || "");
      setnewticket_sn(ticket?.ticket_sn || "");
    }, [ticket]); */
  
    const handleSave = async (e) => {
      e.preventDefault();
      console.log("bouton appuyé");
      const ticketData = {
        service_type: service_type,
        reference: setReference,
        //modele: newModele,
        service_station: service_station,
        terminal_no: newTerminal_no || "",
        client: newclient || "",
        adresse: newadresse,
        service_station: newservice_station || "",
        status: newStaus,
        branch_type: newbranch_type || "",
      };
  
      if (ticket && ticket._id) {
        try {
          const response = await fetch(`/api/equi/${ticket._id}`, {
            method: "PATCH",
            body: JSON.stringify(ticketData),
            headers: {
              "Content-type": "application/json",
            },
          });
  
          let responseData;
  
          if (!response.ok) {
            const errorData = await response.json();
            if (response.status === 400 && errorData.error) {
              setError(errorData.error.toString());
            } else {
              throw new Error(errorData.error || "Error modifying equipment");
            }
          } else {
            responseData = await response.json();
            console.log("Updated equipment data:", responseData);
            handleClose();
          }
        } catch (error) {
          setError(error.toString());
        }
      }
    };
  return (
    <>
    <ToastContainer />

    <div className="fixed top-0 left-0 z-10 flex h-full w-full items-center justify-center ">
      <div className="relative transform overflow-hidden rounded-lg rounded-md border-2 border-tunisys-100 bg-white bg-white p-8 text-left shadow-xl shadow-lg transition-all dark:bg-gray-900 sm:my-8 sm:w-full sm:max-w-lg">
        <h1 className="text-center">Modifier ticket</h1>
        <div className="overflow-x-auto">
          <div className="space-y-1">
            <div className="border-b border-gray-900/10 pb-12">
              <div className="mt-10 grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
                <div className="sm:col-span-3">
                  <label
                    htmlFor="Client"
                    className="block text-sm font-medium leading-6 text-gray-900 dark:text-gray-600">
                    Service Type
                  </label>
                  <div className="">
                    <input
                      type="text"
                      value={service_type}
                      onChange={(e) => setServiceType(e.target.value)}
                      className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                    />
                  </div>
                </div>
                <div className="sm:col-span-3">
                  <label
                    htmlFor="Client"
                    className="block text-sm font-medium leading-6 text-gray-900 dark:text-gray-600">
                    Reference
                  </label>
                  <div className="">
                    <input
                      type="text"
                      value={reference}
                      onChange={(e) => setReference(e.target.value)}
                      className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                    />
                  </div>
                </div>
                <div className="sm:col-span-3">
                  <label
                    htmlFor="Client"
                    className="block text-sm font-medium leading-6 text-gray-900 dark:text-gray-600" >
                    Service station
                  </label>
                  <div className="">
                    <input
                      type="text"
                      value={service_station}
                      onChange={(e) => setServiceStation(e.target.value)}
                      className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                    />
                  </div>
                </div>
                <div className="sm:col-span-3">
                  <label
                    htmlFor="Client"
                    className="block text-sm font-medium leading-6 text-gray-900 dark:text-gray-600">
                    ticket_type
                  </label>
                  <div className="">
                    <input
                      type="text"
                      value={newticket_type}
                      onChange={(e) => setnewticket_type(e.target.value)}
                      className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                    />
                  </div>
                </div>
 
            
              </div>
            </div>
          </div>
          <div className="flex items-center justify-end gap-x-6">
            <button
              type="button"
              onClick={handleClose}
              className="text-sm font-semibold leading-6 text-gray-900  dark:text-white" >
              Cancel
            </button>
            <button
              type="button"
              onClick={handleSave}
              className="text-sm font-semibold leading-6 text-gray-900  dark:text-white"
            >
              save
            </button>
          </div>
          {/*error && <div className="error border rounded mx-0 my-5 p-2.5 border-solid bg-red-300">{error}</div>*/}
        </div>
      </div>
    </div>
  </>  )
}

export default ModifyPhoneTicket
